import React, {Component, useState,useContext} from 'react';
import ReactDOM from 'react-dom';
import {UserContext} from "../../providers/UserProvider";
import './navbar.css';
import logo from '../../img/logo.png';
import {Link} from 'react-router-dom';

const Navbar = (props) => {
  const user = useContext(UserContext);
  const {displayName,photoURL} = user || { displayName: "", photoURL: logo };
  const shouldSignIn =  <img src={photoURL} className="userPhoto" /> ;



  return(
    <div className="mx-auto flex bg-gray-600 w-full shadow">
      <div className="block signinBox mr-5">
         {!user?
        <Link to="signin">
        <img src={logo} className="userPhoto" />
        </Link>
        :
        <img src={logo} className="userPhoto" />
        }

      </div>
      <ul className="flex my-5 float-left">
        <li className="mx-5 ">
          <Link to="/about">About</Link>
        </li>
        <li className="mx-5 ">
          <Link to="/news">News</Link>
        </li>
        </ul>
        <div className="flex flex-row-reverse inOut ml-15 float-right my-5" >
         {user ? <button> Sign Out </button> : <button>Sign In </button> }

        </div>






    </div>
  )

};
export default Navbar;
